import { React, useState } from 'react'
import { useHistory } from "react-router-dom";
import "./style.css"

function App(props) {
    //https://www.youtube.com/watch?v=EwdsnGfrd-k&list=PL7RVBKKO9UqyEr8kqLe9152SIktQjDl64
    const history = useHistory();

    const submitHandler = (event) => {
        event.preventDefault();

        // make the post request here but don't clear the state information.
        // since you'll need the state information to pass between components,
        // once you are done with the confirm page, you can clear the state.
    };

    return (
        <div class="jumbotron text-center">
            <h1>Convert Youtube to Spotify!</h1>
            <form onSubmit={submitHandler}>
                <div>
                    <label htmlFor="first name">first name</label>
                    <input onChange={props.onFirstChange} type="text" id="first name" />
                </div>
                <button type="button" onClick={() => history.push("/convert")}>
                    Confirm
                </button>
            </form>


            <br />
            <br />
            <table>
                <tr>
                    <th>Plan Price</th>
                    <th>Includes</th>
                </tr>
                <tr>
                    <td>Free</td>
                    <td>Up to 25 songs to convert per submission</td>
                </tr>
                <tr>
                    <td>$5.99/month</td>
                    <td>Unlimited songs to convert per submission</td>
                </tr>
            </table>

        </div>
    )
}

export default App
